-- ----------------------------
-- Table structure for base_company
-- ----------------------------
DROP TABLE IF EXISTS `base_company`;
CREATE TABLE `base_company` (
  `company_id` varchar(32) NOT NULL COMMENT '企业ID',
  `code` varchar(32) DEFAULT NULL COMMENT '企业编号',
  `brand` varchar(32) DEFAULT NULL COMMENT '企业品牌',
  `full_name` varchar(32) NOT NULL COMMENT '企业全称',
  `short_name` varchar(32) DEFAULT NULL COMMENT '企业简称',
  `type` varchar(2) NOT NULL COMMENT '企业类型',
  `addr` varchar(100) NOT NULL COMMENT '地址',
  `zip` varchar(32) DEFAULT NULL COMMENT '邮政编码',
  `tel` varchar(32) NOT NULL COMMENT '电话',
  `fax` varchar(32) DEFAULT NULL COMMENT '传真',
  `url` varchar(200) DEFAULT NULL COMMENT '网站',
  `email` varchar(32) DEFAULT NULL COMMENT '电子邮箱',
  `decimal_digits` int(2) DEFAULT '2' COMMENT '保留几位小数',
  `national_tax` varchar(32) DEFAULT NULL COMMENT '国税号',
  `land_tax` varchar(32) DEFAULT NULL COMMENT '地税号',
  `open_bank` varchar(32) DEFAULT NULL COMMENT '开户银行',
  `bank_account` varchar(32) DEFAULT NULL COMMENT '银行账户',
  `remark` varchar(1000) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`company_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='基础信息_物业企业表';

