-- ----------------------------
-- Table structure for charge_fee_item
-- ----------------------------
DROP TABLE IF EXISTS `charge_fee_item`;
CREATE TABLE `charge_fee_item` (
  `fee_item_id` varchar(32) NOT NULL COMMENT '费项ID',
  `charge_method_id` varchar(32) DEFAULT NULL COMMENT '收费方式ID',
  `charge_method_name` varchar(32) DEFAULT NULL COMMENT '收费方式名',
  `pool_method_id` varchar(32) DEFAULT NULL,
  `pool_method_name` varchar(32) DEFAULT NULL,
  `fee_item_type_id` varchar(36) DEFAULT NULL COMMENT '费项类型ID',
  `fee_item_type_name` varchar(32) DEFAULT NULL COMMENT '费项类型',
  `fee_code` varchar(32) DEFAULT NULL COMMENT '费相编号',
  `name` varchar(32) DEFAULT NULL COMMENT '项目名称',
  `fee_unit_price` decimal(9,2) DEFAULT NULL COMMENT '收费单价',
  `fee_period` int(11) DEFAULT NULL COMMENT '收取周期（月）',
  `late_price` decimal(9,2) DEFAULT NULL COMMENT '滞纳金(固定)',
  `late_price_ratio` float DEFAULT NULL COMMENT '滞纳金比例',
  `late_price_type` int(2) DEFAULT NULL COMMENT '滞纳金类型',
  `payment_dealine_period` int(11) DEFAULT NULL COMMENT '缴费限期时间(天数)',
  `room_count` int(11) DEFAULT NULL COMMENT '房间数量',
  `description` varchar(255) DEFAULT NULL COMMENT '描述',
  `remark` varchar(100) DEFAULT NULL COMMENT '备注',
  `state` int(2) DEFAULT NULL COMMENT '状态',
  `create_date` datetime DEFAULT NULL,
  `update_date` datetime DEFAULT NULL,
  `self_fee_item_id` varchar(32) DEFAULT NULL,
  `self_fee_item_name` varchar(36) DEFAULT NULL,
  `company_id` varchar(32) DEFAULT NULL,
  `tree_code` varchar(32) DEFAULT NULL,
  `test` varchar(32) DEFAULT NULL,
  `fee_item_type` varchar(32) DEFAULT NULL COMMENT '费项是属于水费还是电费',
  `ratio` int(7) NOT NULL DEFAULT '1' COMMENT '倍率',
  `print_alias` varchar(50) DEFAULT NULL,
  `sort` decimal(9,2) DEFAULT NULL COMMENT '打印排序号',
  PRIMARY KEY (`fee_item_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='收费管理_费项设置表';

-- ----------------------------
-- Records of charge_fee_item
-- ----------------------------

