DROP TABLE IF EXISTS `charge_house_fee_item`;
CREATE TABLE `charge_house_fee_item` (
  `house_fee_item_id` varchar(32) NOT NULL COMMENT '房间分摊中间表ID',
  `house_id` varchar(32) DEFAULT NULL COMMENT '房间ID',
  `fee_item_id` varchar(32) DEFAULT NULL COMMENT '费项ID',
  `now_num` int(3) DEFAULT NULL COMMENT '本次读数(面积)',
  `fee_unit_price` decimal(9,2) DEFAULT NULL,
  `begin_date` date DEFAULT NULL,
  `percent` int(3) DEFAULT NULL COMMENT '百分比',
  `create_date` datetime DEFAULT NULL,
  `update_date` datetime DEFAULT NULL,
  `company_id` varchar(32) NOT NULL,
  `tree_code` varchar(32) NOT NULL,
  PRIMARY KEY (`house_fee_item_id`),
  KEY `tree_code` (`tree_code`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='收费管理_房间费项中间表';

