-- Table structure for charge_receivable_detail
-- ----------------------------
DROP TABLE IF EXISTS `charge_receivable_detail`;
CREATE TABLE `charge_receivable_detail` (
  `receivable_detail_id` varchar(32) NOT NULL COMMENT '应收明细ID',
  `receivable_detail_code` varchar(32) DEFAULT NULL COMMENT '应收编号',
  `house_id` varchar(32) DEFAULT NULL COMMENT '房间编号',
  `house_name` varchar(255) DEFAULT NULL COMMENT '房间详细名',
  `house_owner_id` varchar(32) DEFAULT NULL COMMENT '业主姓名ID',
  `house_owner_name` varchar(36) DEFAULT NULL COMMENT '业主姓名',
  `fee_item_id` varchar(32) DEFAULT NULL COMMENT '费项ID',
  `self_fee_item_id` varchar(32) DEFAULT NULL COMMENT '公摊对应费项',
  `fee_item_name` varchar(32) DEFAULT NULL COMMENT '费项名称',
  `late_price_ratio` float DEFAULT NULL COMMENT '滞纳金比例',
  `late_price` decimal(9,2) DEFAULT NULL COMMENT '滞纳金固定',
  `late_price_type` int(2) DEFAULT NULL COMMENT '滞纳金类型',
  `payment_dealine_period` int(11) DEFAULT NULL COMMENT '限期(天)',
  `charge_method_id` varchar(32) DEFAULT NULL COMMENT '计算方式',
  `fee_unit` decimal(9,2) DEFAULT NULL COMMENT '收费单价',
  `collect_fee_period` int(11) DEFAULT NULL COMMENT '费项周期',
  `last_num` decimal(9,2) DEFAULT NULL COMMENT '上次读数',
  `this_num` decimal(9,2) DEFAULT NULL COMMENT '本次读数',
  `house_count` int(11) DEFAULT NULL COMMENT '房间数',
  `fee_amount` decimal(9,2) DEFAULT NULL COMMENT '费用金额',
  `fee_amount_bak` decimal(9,2) DEFAULT NULL,
  `period_num` decimal(9,2) DEFAULT NULL COMMENT '周期单位(用量)',
  `this_mouth` varchar(11) DEFAULT NULL COMMENT '截止月份',
  `begin_date` date DEFAULT NULL COMMENT '开始日期',
  `end_date` date DEFAULT NULL COMMENT '截止日期',
  `payment_deadline` date DEFAULT NULL COMMENT '缴费限期',
  `operator_id` varchar(36) DEFAULT NULL COMMENT '操作者ID',
  `operator` varchar(32) DEFAULT NULL COMMENT '操作者',
  `state` int(2) DEFAULT NULL COMMENT '状态:未收款:0 已收款:1',
  `update_date` datetime DEFAULT NULL,
  `create_date` datetime DEFAULT NULL,
  `pref_amount` decimal(9,2) DEFAULT '0.00' COMMENT '优惠金额',
  `coll_amount` decimal(9,2) DEFAULT '0.00' COMMENT '收款金额',
  `collect_fee_id` varchar(36) DEFAULT NULL COMMENT '收费主键',
  `company_id` varchar(32) DEFAULT NULL COMMENT '物业ID',
  `tree_code` varchar(32) DEFAULT NULL,
  `payment_amount` decimal(9,2) DEFAULT '0.00' COMMENT '滞纳金金额',
  `uncoll` decimal(9,2) DEFAULT '0.00',
  `alipay_id` varchar(32) DEFAULT NULL,
  `rebate` decimal(9,2) DEFAULT '100.00' COMMENT '折扣',
  `ratio` int(7) DEFAULT '1',
  `print_alias` varchar(50) DEFAULT NULL,
  PRIMARY KEY (`receivable_detail_id`),
  KEY `this_mouth` (`this_mouth`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='收费管理_应收明细表';

