  `tree_code` char(15) DEFAULT NULL COMMENT '楼宇树号',
  `building_code` varchar(32) DEFAULT NULL COMMENT '楼宇编号',
  `building_fun` varchar(2) DEFAULT NULL COMMENT '楼宇功能',
