  `story_num` int(11) DEFAULT NULL COMMENT '楼层数量',
  `building_height` decimal(9,2) DEFAULT NULL COMMENT '楼高',
  `phase` int(11) DEFAULT NULL COMMENT '楼盘期数',
  `charge_man` varchar(32) DEFAULT NULL COMMENT '负责人',
  `structure_type` varchar(2) DEFAULT NULL COMMENT '结构类型',
  `decorate_type` varchar(2) DEFAULT NULL COMMENT '装修标准',
  `damage_level` varchar(2) DEFAULT NULL COMMENT '完损等级',
  `structure_area` decimal(9,2) DEFAULT NULL COMMENT '建筑面积',
