  `house_id` varchar(32) NOT NULL COMMENT '房间ID',
  `unit_id` varchar(32) NOT NULL COMMENT '单元主键',
  `company_id` varchar(32) NOT NULL,
  `tree_code` varchar(32) NOT NULL COMMENT '房间树号',
  `house_code` char(23) NOT NULL COMMENT '房间编号',
