  `remark` varchar(1000) DEFAULT NULL COMMENT '备注',
  `is_be` tinyint(1) NOT NULL COMMENT '1为''存在'';0为''删除''',
  `house_ext_id` varchar(32) DEFAULT NULL,
  PRIMARY KEY (`house_id`),
